import React from 'react';
import {
    BrowserRouter as Router,
    Route,
    Switch,
    link
} from 'react-router-dom';

export default function RouterApp() {
    <Router>
        <Route path="/">
            <h3>Home</h3>
        </Route>
        <Route path="/acerca">
            <h3>Acerca</h3>
        </Route>
        <Route path="/contacto">
            <h3>Contacto</h3>
        </Route>
    </Router>;
}
